import React from 'react';
import { useNavigate } from 'react-router-dom';


const LandingPage = () => {
  const history = useHistory(); // Get the history object if you're using React Router

  const handleButtonClick = () => {
    history.push('/form'); // Navigate to the form page
    // If not using React Router, use another method to show the form or change pages
  };

  return (
    <div className="landing-container">
      <h1>Welcome to Lawroom AI</h1>
      <button onClick={handleButtonClick} className="application-btn">
        Anticipatory Bail Application
      </button>
    </div>
  );
};

export default LandingPage;
